BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Description_SIMBOLI" (
	"BlockName"	TEXT(50) NOT NULL COLLATE NOCASE,
	"Description_IT"	TEXT(100) COLLATE NOCASE,
	"Description_EN"	TEXT(100) COLLATE NOCASE,
	"Description_FR"	TEXT(100) COLLATE NOCASE,
	"Description_DE"	TEXT(100) COLLATE NOCASE,
	"Description_ES"	TEXT(100) COLLATE NOCASE,
	"Description_CZ"	TEXT(100) COLLATE NOCASE,
	"Description_PO"	TEXT(100) COLLATE NOCASE,
	"Description_FI"	TEXT(100) COLLATE NOCASE,
	"Description_HU"	TEXT(100) COLLATE NOCASE,
	"Description_SL"	TEXT(100) COLLATE NOCASE,
	"Description_PL"	TEXT(100) COLLATE NOCASE,
	"State"	TEXT(1) DEFAULT '' COLLATE NOCASE,
	PRIMARY KEY('BlockName')
);
CREATE UNIQUE INDEX IF NOT EXISTS "idx_Description_SIMBOLI_Campo1" ON "Description_SIMBOLI" (
	'BlockName' COLLATE NOCASE
);
COMMIT;
